        self.label_5.setText(_translate("Form", "<html><head/><body><p><span style=\" font-size:12pt; text-decoration: underline; color:#7030a0; background-color:#ffffff;\">Настройки и теория</span></p><p><span style=\" font-family:\'Wingdings\'; font-size:11pt;\">Ø</span><span style=\" font-size:11pt; text-decoration: underline;\">Настройки.</span></p><p><span style=\" font-family:\'Roboto\'; font-size:10pt; color:#434343;\">....</span><span style=\" font-size:10.5pt; color:#434343;\">1. Перейдя в меню настроек укажите все необходимые значения</span></p><p><span style=\" font-family:\'Roboto\'; font-size:10pt; color:#434343;\">....</span><span style=\" font-size:10.5pt; color:#434343;\">2. Для сохранения результатов нажмите кнопку &quot;Сохранить и выйти&quot;</span><span style=\" font-size:10.5pt; color:#434343; background-color:#ffffff;\">.</span></p><p><br/></p><p><span style=\" font-family:\'Wingdings\'; font-size:11pt;\">Ø</span><span style=\" font-size:11pt; text-decoration: underline;\">Теория.</span></p><p><span style=\" font-family:\'Roboto\'; font-size:10pt; color:#434343;\">....</span><span style=\" font-size:10.5pt; color:#434343;\">1. Выбрав пукнт меню &quot;Теория&quot;, выберите каким образом вы хотите ее просмотреть</span></p><p><span style=\" font-family:\'Roboto\'; font-size:10pt; color:#434343;\">....</span><span style=\" font-size:10.5pt; color:#434343;\">2. Откроется либо браузер с уроками РЭШ по теме кинематики и баллистики,</span></p><p><span style=\" font-family:\'Roboto\'; font-size:10pt; color:#434343;\">....</span><span style=\" font-family:\'Roboto\'; font-size:11pt; color:#434343;\">либо откроется локальный pdf документ с учебником.</span></p></body></html>"))
