        self.label_7.setText(_translate("Form", "<html><head/><body><p><span style=\" font-size:12pt; text-decoration: underline; color:#7030a0; background-color:#ffffff;\">Мгновенное время и начальная высота</span></p><p><span style=\" font-family:\'Wingdings\'; font-size:11pt;\">Ø</span><span style=\" font-size:11pt; text-decoration: underline;\">Мгновенное время.</span></p><p><span style=\" font-family:\'Roboto\'; font-size:10pt; color:#434343;\">....</span><span style=\" font-size:10.5pt; color:#434343;\">1. При построении графика будет найдено время полета и установлено в качестве максимального значения</span></p><p><span style=\" font-family:\'Roboto\'; font-size:10pt; color:#434343;\">....</span><span style=\" font-size:10.5pt; color:#434343;\">2. Выбрав какое-то время на графике появится точка, в которой находилось тело в указанный момент времени*</span><span style=\" font-size:10.5pt; color:#434343; background-color:#ffffff;\">.</span></p><p><span style=\" font-family:\'Roboto\'; font-size:10pt; color:#434343;\">....</span><span style=\" font-family:\'Roboto\'; font-size:11pt; color:#434343;\">* Информация о мгновенном состоянии тела видна в окне &quot;О броске&quot;, однако она не сохраняется</span></p><p><br/></p><p><span style=\" font-family:\'Wingdings\'; font-size:11pt;\">Ø</span><span style=\" font-size:11pt; text-decoration: underline;\">Начальная высота.</span></p><p><span style=\" font-family:\'Roboto\'; font-size:10pt; color:#434343;\">....</span><span style=\" font-size:10.5pt; color:#434343;\">1. При расчете некоторых формул важно знать начальную высоту, поэтому если она известна расчет некоторых</span></p><p><span style=\" font-family:\'Roboto\'; font-size:10pt; color:#434343;\">....</span><span style=\" font-size:10.5pt; color:#434343;\">величин упрощается, </span><span style=\" font-family:\'Roboto\'; font-size:11pt; color:#434343;\">что дает новые, упрощенные комбинации значений</span></p><p><span style=\" font-family:\'Roboto\'; font-size:10pt; color:#434343;\">....</span><span style=\" font-size:10.5pt; color:#434343;\">2. Для смены известности начальной высоты нажмите* на чекбокс. Замена формул и расчетов произойдет</span></p><p><span style=\" font-family:\'Roboto\'; font-size:10pt; color:#434343;\">....</span><span style=\" font-size:10.5pt; color:#434343;\">автоматически</span></p><p><span style=\" font-family:\'Roboto\'; font-size:10pt; color:#434343;\">....</span><span style=\" font-family:\'Roboto\'; font-size:11pt; color:#434343;\">* При указании в &quot;Что вы хотите найти?&quot; пункт &quot;Начальная высота (м)&quot; известность автоматически спадет,</span></p><p><span style=\" font-family:\'Roboto\'; font-size:10pt; color:#434343;\">....</span><span style=\" font-family:\'Roboto\'; font-size:11pt; color:#434343;\"> и вы не сможете ее поменять пока не выберите другой пункт.</span></p><p><span style=\" font-family:\'Roboto\'; font-size:10pt; color:#434343;\">....</span><span style=\" font-family:\'Roboto\'; font-size:11pt; color:#434343;\">Примечание: Пока y0 известна, вы не сможете добавить ее в таблицу и указать значение.</span></p><p><span style=\" font-family:\'Roboto\'; font-size:10pt; color:#434343;\">....</span><span style=\" font-family:\'Roboto\'; font-size:11pt; color:#434343;\">Необходимо снять известность и после этого добавлять. Также, при включении известности y0</span></p><p><span style=\" font-family:\'Roboto\'; font-size:10pt; color:#434343;\">....</span><span style=\" font-family:\'Roboto\'; font-size:11pt; color:#434343;\">из таблицы удалится строка со значением y0 (если такая была).</span></p></body></html>"))
        self.tabWidget.setTabText(self.tabWidget.indexOf(self.tab_6), _translate("Form", "Мгновенное время и начальная высота"))
